import React from 'react';
import ReactDOM from 'react-dom';
// import "../General/Cards/Cards.js";
// import "../General/Cards/Cards.css";
// import "../Parts/Header/Header.js";
// import "../Parts/Header/Header.css";
// import "../Parts/Footer/Footer.js";
// import "../Parts/Footer/Footer.css";
import Header from '../../Parts/Header/Header'
import './ContactUs.css'

class ContactUs extends React.Component {
  render(){
    return(
    <div className="container-fluid bgCont pl-0 pr-0 ml-0 mr-0">
      <Header className="header2"/>
      <div id="content" class="mt-5 pt-5">
        <div id="welcome" class="container text-center titleFont">
          <h1>Welcome </h1>
          <h4>We are looking forward to help you create the house of your dreams</h4>
        </div>

        <div id="mainCard" class="card-group justify-content-center container mt-5 pt-3 ">
          <div class="card carditem text-center rounded  col-md-3 col-sm-12 mr-2 txtFont">
            <i class="fa fa-home pt-4 cardIcon"></i>
            <div class="card-body">
              <h5 class="card-title titleFont secondTitle">Visit Us</h5>
              <p class="card-text">You are welcomed to our office </p>
              <p class="card-text"> Sun - Thu 08:30-16:30 </p>
              <p class="card-text"> Location : Israel , Beit jann  </p>
              <p class="card-text">  Northen St. </p>
            </div>
          </div>

          <div class="card carditem text-center rounded col-md-3 col-sm-12 mr-2 txtFont">
            <i class="fas fa-phone-volume pt-4 cardIcon"></i>
            <div class="card-body">
              <h5 class="card-title secondTitle">Call Us</h5>
              <p class="card-text"> We would love to hear from you <br/>
                Tel: 04-0000000 <br/>
                In case we didn’t answer, we’ll be gladly back in 24 hours. <br/>Thanks for your patience
              </p>
            </div>
          </div>

          <div class="card carditem text-center rounded col-md-3 col-sm-12 mr-2 txtFont">
          <i class="fas fa-address-book pt-4 cardIcon"></i>
          <div class="card-body">
            <h5 class="card-title secondTitle">Contact Us</h5>
            <p class="card-text text-dark pt-5" data-toggle="modal" data-target="#myModal">Let’s set an appointment together</p>
            {/* <!-- Modal --> */}
            <div className="modal fade" id="myModal" role="dialog">
              <div className="modal-dialog modal-md mt-5">
                <div className="modal-content modalBg">
                  <div className="modal-body">
                    <button type="button" class="close mt-3" data-dismiss="modal">&times;</button>
                    <h3 className="heading no-bg mb-2 mt-3 ">Would you like to discuss a project?</h3>
                    <h5 className="heading no-bg mt-5 ">Please fill up your details and we'll be in touch</h5>
                    <form name="myForm" class="contact-form-wrapper ml-5 mt-3 needs-validation " data-toggle="validator" novalidate="true" onsubmit="return validateForm()">
                    <div class="col-10 ">
												<div class="form-group">
													<input id="inputName" type="text" class="form-control" placeholder="Your Name*" data-error="Your name is required" required="" name="fname"/>
                          <div class="valid-feedback">Valid.</div>
                          <div class="invalid-feedback">Please fill out this field.</div>
												</div>
											</div>
                    </form>
                  </div>
                  <div class="modal-footer">
                    <button type="button" class="btn btn-light mt-3 font-weight-bold">or you can set an appointment</button>
                  </div>
                </div>
              </div>
            </div>
          </div>
          </div>
        </div>

      </div>
    </div>
      );

      // <Cards/>

  }
}

export default ContactUs;
